desc:
The Chapter is organized and will be operated for educational and scientific purposes to promote the following: 

an increased knowledge of and greater interest in the mathematical sciences, including pure and applied mathematics, statistics, and their applications; 

a greater understanding of the contributions of women in the mathematical sciences; 

and mentoring and encouraging women and girls as they prepare for careers in the mathematical sciences.

The purpose of Every Nation Campus at UW is to be a diverse group of Christian students, staff, and associate members who are committed to serving the UW campus by:

 Sharing the knowledge of life in Christ Jesus with the UW community;

Helping people in their relationship with Jesus Christ and providing them with training for victorious Christian living, leadership, and excellence;

Introducing its members to a local church family and other missions or ministry opportunities;

 Making a positive impact on the UW campus by developing students, equipped with biblical solutions to contemporary problems, to serve every facet of the UW community and ultimately the world.
